import React, { Component } from 'react';
import './App.css';
import Main from './components/MainComponent';
import {BrowerRouter} from 'react-router-dom'


export default class App extends Component {

  render() {
    return (
      <BrowerRouter>
        <div className="App">
          <Main />
        </div>
      </BrowerRouter>
    );
  }
}
